import axios from "axios";
//https://api.themoviedb.org/3/movie/550?api_key=
//https://api.themoviedb.org/3/search/movie?api_key=172c72b78f475e54c01895081cfafdea&query=%27%27
const MovieSearchApp = () => {
  useEffect(() => {
    async function FetchData() {
      const result = await axios.get(
        `https://api.themoviedb.org/3/movie/550?api_key=172c72b78f475e54c01895081cfafdea`
      );
      console.log(result.data);
    }
    FetchData();
  }, []);

  return (
    <div className="p-10">
      <div className="w-full max-w-[500px] mx-auto mb-20">
        <input
          type="text"
          className="w-full p-5 rounded-lg border border-purple-500 shadow-[0px_0px_0px_3px_rgba(125,_106,_255,_0.2)]"
          placeholder="Search movie"
        />
      </div>
      <div className="grid grid-cols-3 gap-10 ">
        <MoiveItem></MoiveItem>
        <MoiveItem></MoiveItem>
        <MoiveItem></MoiveItem>
      </div>
    </div>
  );
};

const MoiveItem = () => {
  return (
    <div className="p-3 bg-white rounded-2xl shadow-sm">
      <div className="h-[297px]">
        <img
          src="https://images.unsplash.com/photo-1638913662252-70efce1e60a7?ixlib=rb-1.2.1&ixid=MnwxMjA3fDF8MHxlZGl0b3JpYWwtZmVlZHwyMXx8fGVufDB8fHx8&auto=format&fit=crop&w=500&q=60"
          alt=""
          className="w-full h-full object-cover rounded-lg"
        />
      </div>

      <div className="p-7">
        <h3 className="text-xl text-black font-semibold mb-4">
          Hotel Transylvania: Puppy!
        </h3>
        <p className="text-[#999]">
          Lorem ipsum dolor sit, amet consectetur adipisicing elit. Tenetur
          tempora quisquam impedit, quibusdam necessitatibus sint animi numquam
        </p>
      </div>
    </div>
  );
};

export default MovieSearchApp;
